import React from "react";
import { StyledIconButton } from "./Styled";

const StyledButton = ({ label, variant }) => {
  return (
    <StyledIconButton variant={variant} disableRipple>
      {label}
    </StyledIconButton>
  );
};

export default StyledButton;
